import React from 'react';
import "./table.css";



function BasicTable({data}) {
  var days = [
    "ראשון",
    "שני",
    "שלישי",
    "רביעי",
    "חמישי",
    "שישי"
  ]
  return(
    <table className="table">
      <thead>
        <tr>
          <th scope="col">שם מתנדב</th>
          <th scope="col">יום</th>
          <th scope="col">שעה</th>
          <th scope="col">יעד נסיעה</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item) => (
          <tr>
            <td>{item.Name}</td>
            <td>{days[item.Day]}</td>
            <td>{item.Hour}</td>
            <td>{item.Hospital}</td>
          </tr>
        ))}
    </tbody>
    </table>
)


